import React, { Component } from "react";
import {Link} from 'react-router-dom';
import ReactDOM from 'react-dom';

import { Layout, Menu, Breadcrumb } from 'antd';
import 'antd/dist/antd.css';
import './index.css';

const { Header, Content, Footer } = Layout;

